export const schema = `{
    "type": "object",
    "tablename": "People",

    "properties": {

      "Full Name": {
        "type": "string"
      },

      "Birthdate": {
        "type": "string",
        "format": "date"
      },

      "Company ID": {
        "type": "integer",
        "minimum": 100000,
        "maximum": 999999
      },

      "Department": {
        "type": "string",
        "enum": ["R&D", "Sales", "Marketing", "Management"]
      },

      "Uses company car": {
        "type": "boolean"
      }

    },

    "required": [
      "name",
      "birthdate",
      "company id",
      "department",
      "uses company car"
    ]
  }`;

export default schema
